import './insertMovie.css'
function InsertMovie(props){

    function dialog(){
        const favDialog = document.getElementById('favDialog');
        if(favDialog!= null)
        favDialog.showModal();
    }

    const data = props.data;
    var image = (`../images/${data.image}`);
    console.log(image);
    return(
        <div className="col-6 col-xl-4  mb-2">
            <img className="main-img" src= {data.image} onClick={() => dialog()} />
            {dialog()}
            <dialog id="favDialog">
                <form method="dialog">
                    <p>
                    <label>Favorite animal:
                        <select>
                        <option value="default">Chooseâ€¦</option>
                        <option>Brine shrimp</option>
                        <option>Red panda</option>
                        <option>Spider monkey</option>
                        </select>
                    </label>
                    </p>
                    <div>
                    <button value="cancel">Cancel</button>
                    <button id="confirmBtn" value="default">Confirm</button>
                    </div>
                </form>
            </dialog>
            <p>
            <button id="updateDetails">Update details</button>
            </p>
            <output></output>
            <div>
                <label>{data.title}</label>
            </div>

        </div>

    )

};

export default InsertMovie;
